import { FaBars } from "react-icons/fa";
import { NavLink as Link } from "react-router-dom";
import styled from "styled-components";

export const Nav = styled.nav`
    background: #ffb3ff;
    height: 50px;
    display: flex;
    justify-content: center;
    padding: 10px 0;
    z-index: 100;
`;
